import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './pages/Login/index.jsx';
import DashBoard from './pages/Dashboard/index.jsx';
// import SafetyDigitilization from './pages/SafetyDigitilization/index.jsx';
import WorkPermit from './pages/WorkPermits/index.js';
import Modules from './pages/Modules/index.js';
import SingleWorkPermit from './pages/WorkPermits/SingleWorkPermit.js';
// import AllKySheets from './pages/AllKYSheets/index.js';
import MainLayout from './components/mainLayout/index.js';
import MarutiHomePage from './components/MarutiHomePage/index.js';
import SecondPage from './components/Screen2/Index';


function AppRoutes() {
    return (
        <>
            <Router>
                <Routes>
                    <Route path="/" element={<Login />} />
                    <Route
                            path="module"
                            element={<Modules />}  
                        />
                    <Route element={<MainLayout />}>
                        <Route
                            path="dashboard"
                            element={<DashBoard />}
                        />
                        <Route
                            path="work-permit"
                            element={<WorkPermit />}
                        />
                        <Route
                            path="work-permit/:id"
                            element={<SingleWorkPermit />}  
                        /> 
                    </Route>
                    <Route
                            path="home"
                            element={<MarutiHomePage />}  
                    ></Route>
                    <Route
                            path="cards"
                            element={<SecondPage />}  
                    ></Route>

                </Routes>

            </Router>
        </>
    );
}

export default AppRoutes
